

# Counting Valleys
# https://www.hackerrank.com/challenges/counting-valleys/problem

"""

Valleys start at sealevel then go below and rise to/above sealevel

How many valleys are there?

Input
steps
sequence of up down, UD


Bonus:
Try printing the trip


8
UDDDUDUU



12
DDUUDDUDUUUD

"""

n = int(input().strip())
s = input().strip()
listofthings = []
levels = []
start = False
end = False
count = 0
cp = 0
clevel = 0
contingencyvalley = 0
for i in s:

    if i == "U":
        clevel+=1
        listofthings.append("/")
        levels.append(clevel)
    else:
        clevel-=1
        listofthings.append('\\')
        levels.append(clevel)

    if levels[cp] > 0:
        contingencyvalley = 1
    if levels[cp] == -1 and levels[cp - 1] == 0:
        start = True
    elif levels[cp] == 0 and levels[cp - 1] == -1:
        end = True
    if start == True and end == True:
        count+=1
        print(start, end)
        print(cp, cp-1)
        print(levels)

        end = True
    if clevel >0:
        start = False
    cp +=1
# Single Valley Contingency
if levels[-1] == 0 and count ==0 and contingencyvalley == 0:
    count+=1


print(count)
print(levels)



